function removeAccents(stringWithAccents) {
  var string = stringWithAccents;
	var mapAccentsHex = {
		a : /[\xE0-\xE6]/g,
		e : /[\xE8-\xEB]/g,
		i : /[\xEC-\xEF]/g,
		o : /[\xF2-\xF6]/g,
		u : /[\xF9-\xFC]/g,
		c : /\xE7/g,
		n : /\xF1/g
	};

	for(var letter in mapAccentsHex) {
		var regex = mapAccentsHex[letter];
		string = string.replace( regex, letter);
	}
	return string;
}

var formatUri = function formatUri(stringToFormat) {
	return removeAccents(stringToFormat.toLowerCase()).replace(/\s+/g, "-").replace(",", "-").replace("\\", "").replace("/", "").replace("\'", "").replace('"', "");
};

var indentCode = function indentCode(code, qtd) {
	var spaces = '    ';
	for(var i = 0; i < qtd; i++) {
		code = spaces + code;
	}
	return code;
};

var formatQuotationMarks = function formatQuotationMarks(stringToFormat) {
	if(stringToFormat !== undefined)
		return stringToFormat.replace('\'', '\\\'');
	return stringToFormat;
};

var formatVarcharColumnValue = function formatVarcharColumnValue(stringToFormat) {
	if(stringToFormat === undefined)
		return 'null';
	else
		return '\''+stringToFormat+'\'';
};

